  `timezone` varchar(8) COLLATE  DEFAULT NULL,
  `lat` varchar(32) COLLATE  DEFAULT NULL,
  `lon` varchar(32) COLLATE  DEFAULT NULL,
  `num_airports` int(11) DEFAULT NULL,
  `city` varchar(32) COLLATE  DEFAULT NULL,
  PRIMARY KEY (`code`)
) 

